data.text:
@LuukDobbe Hi Luuk 
If you have made a request via SAS customer care and received a case id 7 numbers they will reply to you as soon as they can , due to high volume it can take some time and we apologize for that. 
Kind regards /Anna

@Bigtunaheyohh Hi Joe
With separate tickets rebooking or refund does usually not apply but make a complaint after the journey has ended and SAS customer care will have a look at you case, you contact them by https://t.co/saQXo2wpQa(feedback
Kind regards/ Anna

@Mkiverijn Hello Morten
You can see the offer here https://t.co/JMQpZuC78N it is stated that it is when you are traveling with us.
Kind regards /Anna

@KajsaCork Hi Anna
Contact our customer service on live chat, phone   https://t.co/b3QIqPk7bj    or Facebook messenger and we can look at your questions.
Kind regards /Anna

@Bigtunaheyohh Hi Joe
If you have not received any alternative please contact us by phone so we can help you https://t.co/b3QIqPk7bj   if the ticket is booked via travel agency you contact them.
Kind regards /Anna

@CinWalker Hi Jacinta
Contact us by phone and we can help you further https://t.co/b3QIqPk7bj
Kind regards /Anna

@figgebee Hi Figgbee
It is IT that handles the webpage, thank you for your feedback I will forward it. If you want to make any complaint you are welcome to contact SAS customer care via their webform https://t.co/cE0TvFYaMV
Kind regards /Anna

@TheSwipeNasty Hello
If the voucher is refundable you can request refund when it has expired via https://t.co/ui2Ls6yWKm if you need assistanse from us please contact us with your vouchernumber on live chat https://t.co/b3QIqPk7bj or Facebook messenger.
Kind regards /Anna

@Mkiverijn Hello
The offer is only for SAS flights (Widerö is not included for example) you can retroregistrate via your eurobonusprofile.
Kind regards /Anna

@Rahulkochhar20 Hi Rahul
If you can not rebook via my bookings on https://t.co/saQXo2wpQa you can use the number for All other countries: +46 8797 3010
Kind regards /Anna

@sweetdream4all Hi Patrick
Contact our customer service on phone , live chat   https://t.co/b3QIqPk7bj   or Facebook messenger and we will look at this.
Kind regards /Anna

@_Blench_ Hello
Unfortunately we do not perform the tests so we are unable to do anything with the price. 
Kind regards /Anna

@JoeBlack2k Hi Jeroen
Please contact us on phone , live chat   https://t.co/b3QIqPk7bj   or Facebook messenger and we will look at this.
Kind regards /Anna

@jotatofu Hello
You are welcome to contact us on phone , live chat    https://t.co/b3QIqPk7bj   or Facebook messenger and we will assist.
Kind regards /Anna

@gabriel12432 Hi Gabe 
If you have not been rebooked yet you are welcome to contact us on phone https://t.co/b3QIqPk7bj if you want to cancel and request refund we can assist by live chat or Facebook messenger.
Kind regards/Anna

@UserNameTag1 Hello
Try logging in with your new password and eurobonusnumber (only the 9 numbers) as username , google chrome usually works good. If that does not solve it please contact us on live chat or Facebook messenger https://t.co/b3QIqPk7bj and we can assist.
Kind regards /Anna

@IcedorIsse Hej Icedor
Priset kan variera beroende på platstillgång, är det mycket bokat på ett specifikt flyg så kan prisklasserna ha gått upp. Som en förklaring till varför ett flyg kan ha ett högre pris än ett annat.
Vänliga hälsningar /Anna

@APxx77 Hi Adam 
Please contact us on live chat , phone    https://t.co/b3QIqPk7bj    or Facebook messenger so we can look at what happened with your refund. We can not support this by twitter.
Kind regards /Anna

@laritaramallo Hi! 

We should be able to help you add a pet to your booking, but it's not always possible as it depends a little on the start/destination and if there is any space left for a pet. The best i can recommend is to call our customer service/chat again.

//Best regards, Dennis.

@TAFarestveit Hej! 

Jag beklagar att du har fått väntat så länge, vi har dessvärre en lång kötid just nu men våra agenter jobbar på att svara så fort som möjligt. Så det bästa jag kan rekommendera är att ringa vår kundtjänst.

//Vänlig hälsning, Dennis.

@Itslissy1 Hi, an underseat bag is something like a laptop bag, a handbag or similar. This is not the regular carry-on baggage. You can read more information about carry-on baggage at https://t.co/2UUXPRN2w1

Best regards,
Anton.

@travelpessimist Hi, customer service does not have access to the systems to localize luggage unfortunately but you can try to contact Baggage Service for assistance, phone numbers are listed on https://t.co/ZV9bTO3uo2

Best regards,
Anton.

@marcnoruega Hi, if you have an international connection Travel Ready Center cannot be used for your booking, please proceed to the airport for manual document approval.

Best regards,
Anton.

@figgebee Hello, thank you for your feedback. The latest travel/entry restrictions information provided by IATA is located on https://t.co/oj06rsDGPg

Best regards,
Anton.

@Tariq__Saleh Hello
How can we help you?
https://t.co/b3QIqPk7bj

@LailaWellbeing Hi, there are staffed check-in desks at the airport who can help with manual check-in.

Best regards,
Anton.

@Felixotan Hej, detta behöver du kolla med ankomstservice på flygplatsen, beroende på vilka rutiner de har kan det eventuellt vara möjligt att checka in bagaget kvällen före din flight.

Med vänlig hälsning,
Anton.

@mu22le Hi, we do not require a negative test in order to board the flight unless the destination you are traveling to requires this. More information about the entry restrictions for your destination can be read at https://t.co/oj06rsDGPg

Best regards,
Anton.

@_ChloeSmyth Hello! 
Note that it is not possible to print the boarding pass online for all bookings. When you receive this message, you will need to go to check in at the airport to complete the check-in process and get your boarding pass. 

Have a nice trip, regards Anja!

@_DarrenSweeney Hello!
Please report the issue to our app-team. You do this in the app, via "more" and "app feedback". 

Thank you for contacting us, regards Anja!

@SamLaughlin Hi! I'm sorry to hear your luggage is delayed.

Delayed baggage must be reported at the airport upon arrival so that we can create a report for your case. Note that these matters are handled by luggage service, contact information can be found here: https://t.co/ZV9bTO3uo2

/Anja

@SjefKirurgen Hej Bjørn 
Vi kan också kansellera biljetter via live chat https://t.co/cIkJt9kPnF eller Facebook messenger om du vill kontakta oss där.
Med vänliga hälsningar /Anna

@birgitteCN Hi Birgitte
The price is set according to the availability , if someone cancel their ticket it can be available again. The price is not adjusted by SAS it is set by how many tickets are available. 
Kind regards/ Anna

@grumblingjay Hi Grumblingjay
We are sorry to hear that. The handling time with customer care is approx. 6 - 8 weeks and they reply on e-mail , if more time has passed please contact us with your Case id 7 numbers on Facebook messenger and we will take a look.
Kind regards/Anna

@jortegakb Hi!
I'm very Sad to hear that your flight has been rebooked. You are welcome to call our rebooking support and they will help you find a new flight that suits you better.
With regards Liv

@KRZYSZTOF_UK Hi, please contact us via FB Messenger or live-chat https://t.co/b3QIqPk7bj with your original booking reference and we can help you take a look at what possibilities there are.

Best regards,
Anton.

@REimhin Hi, I'm sorry to hear that your flight is canceled. If you are not able to contact customer service before your flight today please proceed to the airport for assistance.

Best regards,
Anton.

@GeolierMathilde Hello, sadly we are not able to assist you with this matter over social media. We apologize for the longer than usual response time from Customer Care at the moment but please allow some more time and they will get back to you as soon as possible.

Best regards,
Anton.

@XimenaBahnsen Hello, if you have received a schedule change of your reservation we kindly ask you to contact us by phone. Our phone numbers are located on https://t.co/b3QIqPk7bj

Best regards,
Anton.

@victorwdc Hi, we don't have an email for general support errands but you can contact us on FB Messenger, live-chat or phone https://t.co/b3QIqPk7bj

Best regards,
Anton.

@returnofserve Hello, if the online check-in is not working for your flight we kindly ask you to complete the check-in on the airport instead.

Best regards,
Anton.

@riley_globetrtr Hello! To request a special meal for your flight please contact us on live-chat https://t.co/b3QIqPk7bj or FB messenger with your booking reference and your special meal preference. The special meal has to be requested at least 24 hours before departure.

Best regards,
Anton

@Aizhan135 Hello, sadly we are not able to look into individual cases over social media, please contact us on FB Messenger or live-chat https://t.co/b3QIqPk7bj with your booking details and we can help you take a look at this.

Best regards,
Anton.

@beggbiee Hi, please contact us on FB Messenger or live-chat https://t.co/b3QIqPk7bj with your booking reference and we can help you take a look at the refund status over there.

Best regards,
Anton.

@RebeccaWUvell Hej! Det är resenärens egna ansvar att informera sig om och hålla sig uppdaterad om de senaste inresereglerna för sin destination, på grund av regeringsmandat och restriktioner kan inresereglerna komma att ändras när som helst med kort varsel före er avresa.

//
Anton.

@Maddelan Hello, you can find the latest entry/transit restrictions that we have received from IATA at https://t.co/oj06rsDGPg - If you need more detailed information, we recommend you to contact your local authorities or the respective country's embassy.

Best regards,
Anton.

@AngelaHoisingt2 Hello, your SAS travel voucher can be used to book any flight that is available on https://t.co/BlgfvicYhk

Best regards,
Anton.

@abcETF Hi, yes we require all passengers to wear a face mask during the flight, this is in accordance with recommendations from EASA and international health authorities.

Best regards,
Anton.

@Fendeland Hej, Surströmming är inte tillåtet att ta med ombord på flygen, varken i det incheckade bagaget eller handbagaget.

Hälningar,
Peter

@returnofserve Hi, It sometimes happen that online check in is not available. When check in can not be done in advance, you will receive the boarding card at the airport. 

Regards,
Peter
